import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav className="bg-darkGray p-4">
      <div className="container mx-auto flex justify-between items-center">
        <Link to="/" className="text-teal text-xl font-bold">Spotify Top Songs</Link>
        <div>
          <Link to="/top-songs" className="text-white mr-4 hover:text-hoverGray">Top Songs</Link>
          <Link to="/search" className="text-white hover:text-hoverGray">Search</Link>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
